import { Component } from '@angular/core';

@Component({
  selector: 'app-login',
  templateUrl: './login.component.html',
  styleUrls: ['./login.component.css']
})
export class LoginComponent implements OnInit {
  login: FormGroup | any
  constructor(private _http:HttpClient, private route:Router, private auth: AuthService) { }

  ngOnInit(): void {
    this.login=new FormGroup({
      'email':new FormControl(),
      'password':new FormControl()

    })
  }

  logindata(){
   this.auth.logindata(this.login) //Appel de la méthode de connexion
  }

}
